function init(){for(var imgDefer=document.getElementsByTagName("img"),i=0;i<imgDefer.length;i++)if(imgDefer[i].getAttribute("data-src")){imgDefer[i].setAttribute("src",imgDefer[i].getAttribute("data-src"));var src=imgDefer[i].getAttribute("data-src")}}function slideshow(){setInterval((function(){nextSlide("SFR-ss")}),2e3)}function nextSlide(id){var elems=document.getElementById(id).getElementsByClassName("slide");elems.index=elems.index||0,elems[elems.index].className="slide",elems.index=(elems.index+1)%elems.length,elems[elems.index].className="slide showing"}function collapsible(idName,className,className2){const array=document.getElementById(idName).getElementsByClassName(className),contents=document.getElementById(idName).getElementsByClassName(className2);for(let i=0;i<array.length;i++)array[i].addEventListener("click",(function(){for(let j=0;j<contents.length;j++)contents[j].style.height="0px";if(this.classList.contains("active"))this.classList.remove("active");else{for(let k=0;k<array.length;k++)array[k].classList.remove("active");this.classList.toggle("active");var content=this.nextElementSibling;content.style.height=content.scrollHeight+"px"}}))}init(),onload=slideshow,collapsible("ss-collapsible","collapsible","content");